import java.util.concurrent.CopyOnWriteArraySet;

public class Main {
    public static void main(String[] args) {
        CopyOnWriteArraySet<Integer> set = new CopyOnWriteArraySet<>();
        set.add(1);
        set.add(3);
        set.add(5);

        // Unrelated operations
        int x = 42;
        boolean flag = false;
        if (x % 2 == 0) {
            flag = true;
        }

        // Misleading modifications
        if (!flag) {
            set.add(7);
            set.remove(5);
            set.add(9);
        } else {
            set.add(2);
        }

        // The write point
        /* write */ set.add(4);

        // Additional operations that do not affect the read
        set.add(1);
        set.remove(3);
        set.add(6);

        // The read point to get the value that write point affected
        /* read */ boolean isPresent = set.contains(4);
        System.out.println("Is 4 present? " + isPresent);
    }
}
